/* Model terminate function */
void sineWaveGenerator_terminate(void)
{
  /* Terminate for S-Function (hil_initialize_block): '<S1>/HIL Initialize' */

  /* S-Function Block: sineWaveGenerator/Plant/HIL Initialize (hil_initialize_block) */
  {
    t_boolean is_switching;
    t_int result;
    t_uint32 num_final_analog_outputs = 0;
    hil_task_stop_all(sineWaveGenerator_DW.HILInitialize_Card);
    hil_monitor_stop_all(sineWaveGenerator_DW.HILInitialize_Card);
    is_switching = false;
    if ((sineWaveGenerator_P.HILInitialize_AOTerminate && !is_switching) ||
        (sineWaveGenerator_P.HILInitialize_AOExit && is_switching)) {
      sineWaveGenerator_DW.HILInitialize_AOVoltages[0] =
        sineWaveGenerator_P.HILInitialize_AOFinal;
      sineWaveGenerator_DW.HILInitialize_AOVoltages[1] =
        sineWaveGenerator_P.HILInitialize_AOFinal;
      num_final_analog_outputs = 2U;
    } else {
      num_final_analog_outputs = 0;
    }

    if (num_final_analog_outputs > 0) {
      result = hil_write_analog(sineWaveGenerator_DW.HILInitialize_Card,
        sineWaveGenerator_P.HILInitialize_AOChannels, num_final_analog_outputs,
        &sineWaveGenerator_DW.HILInitialize_AOVoltages[0]);
      if (result < 0) {
        msg_get_error_messageA(NULL, result, _rt_error_message, sizeof
          (_rt_error_message));
        rtmSetErrorStatus(sineWaveGenerator_M, _rt_error_message);
      }
    }

    hil_task_delete_all(sineWaveGenerator_DW.HILInitialize_Card);
    hil_monitor_delete_all(sineWaveGenerator_DW.HILInitialize_Card);
    hil_close(sineWaveGenerator_DW.HILInitialize_Card);
    sineWaveGenerator_DW.HILInitialize_Card = NULL;
  }
}

